# https://leetcode.com/problems/largest-palindromic-number/

class Solution:
    def largestPalindromic(self, num: str) -> str:

        if all(x == '0' for x in num):
            return "0"

        dict_num = {}

        for n in num:
            dict_num[int(n)] = dict_num.get(int(n), 0) + 1

        # find max odd number value
        left_side = ""
        center_num = []

        for k, v in dict_num.items():
            left_side = left_side + str(k) * (v // 2)
            if v % 2 == 1:
                center_num.append(k)

        print(dict_num)

        # left = ''.join(sorted(left_side, reverse=True)).lstrip('0')
        center = ''
        # if len(center_num) > 0:
        #     center = ''.join(str(max(center_num)))
        # right = ''.join(sorted(left_side)).rstrip('0')

        # return left + center + right
        return center


